import React from 'react';
import { HashRouter as Router, Switch, Route } from 'react-router-dom';

//Component
import MainPage from './view/MainPage';
import Navbar from './Navbar';

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path='/' exact component={MainPage}></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
